n = int(input())

empty = [0 for i in range(n)]
zero = [False for i in range(n)]

for i in range(n):
	empty[i] = list(map(int, input().split()))

for i in range(n):
	if not zero[i]:
		j = i
		while j < n:
			empty[j].append(0)
			j += 1
			if j >= n:
				zero[j] = True

if not zero[0]:
	print(-1)
else:
	print(3 * empty[0][n - 1] + 2 * empty[0][n - 2])
